import { Component, Input } from '@angular/core';
import { HlmButtonDirective } from '@spartan-ng/ui-button-helm';

@Component({
  selector: 'mantis-button',
  standalone: true,
  imports: [HlmButtonDirective],
  template: `
  <button hlmBtn [variant]="variant" [size]="size">
    <ng-content></ng-content>
  </button> `,
})
export class ButtonComponent {
  @Input() variant: 'secondary' | 'destructive' | 'outline' | 'ghost' | 'link' | 'default' = 'default';
  @Input() size: 'default' | 'sm' | 'lg' | 'icon' = 'default';

}

import { Component, Input, inject } from '@angular/core';
import { HlmIconComponent, IconSize } from '@spartan-ng/ui-icon-helm';
import { provideIcons, IconName } from '@ng-icons/core';
import { lucideMail, lucideUser2 } from '@ng-icons/lucide';
import { ICONS } from './icon.token';

@Component({
  selector: 'mantis-icon',
  standalone: true,
  imports: [HlmIconComponent],
  providers: [
    {
      provide: ICONS,
      useValue: {
        lucideMail: 'lucideMail',
        lucideUser2: 'lucideUser2',
      }
    },
    provideIcons({
      lucideMail,
      lucideUser2
    }),
  ],
  template: `
    <hlm-icon
      [name]="name"
      [size]="size"
      [color]="color"
      [strokeWidth]="strokeWidth"
      [class]="class"></hlm-icon>
  `,
})
export class IconComponent {
  private icons: Record<string, IconName> = inject(ICONS);
  @Input({ required: true }) name!: IconName; // Required
  @Input() size: IconSize = 'none';
  @Input() color?: string;
  @Input() strokeWidth?: string | number;
  @Input() class?: string;
}

